const SourceSerifProRegular = `@font-face { font-family: 'Source Serif Pro'; font-style: normal; font-weight: 400; src: local('Source Serif Pro'), local('SourceSerifPro-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const SourceSerifPro700 = `@font-face { font-family: 'Source Serif Pro'; font-style: normal; font-weight: 700; src: local('Source Serif Pro Bold'), local('SourceSerifPro-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const SourceSerifPro600 = `@font-face { font-family: 'Source Serif Pro'; font-style: normal; font-weight: 600; src: local('Source Serif Pro Semibold'), local('SourceSerifPro-Semibold'), url('data:font/woff2;base64,') format('woff2'); }`;
